st heal, antirecoil senza mirare per ogni arma, ping auto, ispezziona, corsa auto, bunny hop, mira auto, crounch shot, strafe shot, release aim, ricarica auto....\n\nMax script: \n settato per sens avanzata di default ma potete usare la vostra sens. \nNel primo slot mettiamo un antirecoil generale per tutte le armi, in tutti gli altri slot mettiamo 2 armi, cosi da avere tutte le armi preferte.\n3 Tipi di aim assist\nMods: swap shield, superglide, rapidfire, antirecoil senza mirare, ping auto, ispezziona, bunny hop, mira auto, crounch shot, strafe shot, release aim....\n\n"},{"text":"00:00","navigationEndpoint":{"clickTrackingParams":"CB0Q040EGAIiEwij4piKs__6AhUIaZsKHRqZBNc=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=rpjvWfl3Ias\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"rpjvWfl3Ias","continuePlayback":true,"startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-8xjug5oxu-f5fs.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026bui=0\u0026msp=1\u0026odeak=1\u0026odepv=1\u0026osfc=1\u0026id=ae98ef59f97721ab\u0026ip=31.11.128.139\u0026initcwndbps=2403750\u0026mt=1666838700\u0026oweuc="}}}}}},{"text":" Antirecoil\n"},{"text":"00:13","navigationEndpoint":{"clickTrackingParams":"CB0Q040EGAIiEwij4piKs__6AhUIaZsKHRqZBNc=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=rpjvWfl3Ias\u0026t=13s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"rpjvWfl3Ias","continuePlayback":true,"startTimeSeconds":13,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-8xjug5oxu-f5fs.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u002
